import React from 'react'
import './Sidebar.css'
import SearchBar from "react-native-dynamic-search-bar"

export default class SearchDiv extends React.Component {
    render() {
        return (
            <div id="searchDiv">
            <SearchBar
  placeholder="Search here"
  onChangeText={text => {
    console.log(text)
  }}
  onPressCancel={() => {
    this.filterList("");
  }}
  onPress={() => alert("onPress")}
/>
          </div>
        );
    }
}
